To solve the issue I updated to version 1.8.0.

Access points are working correctly with wayback 1.8.0.



From: Ferencz Marton [mailto:ferencz.marton@...] 
Sent: Monday, June 03, 2013 3:17 PM
To: archive-crawler@yahoogroups.com
Subject: RE: [archive-crawler] Wayback Access Point problem



It seems that my problem is making wayback working with access points.

If I install a clean wayback (1.6.0), set the index location and url prefix
and at the default Access Point I leave the default &quot;8080:wayback&quot; (wayback
installed with wayback.war) the page does not show up correctly:



The only way I can make it work, is to delete the &quot;:wayback&quot; from the access
point name. But If I try to add another access point with the parent &quot;8080&quot;,
the access point will not work.



What do I need to modify to make wayback work on 8080:wayback?

Thanks.



From: archive-crawler@yahoogroups.com
[mailto:archive-crawler@yahoogroups.com] On Behalf Of Andrew Jackson
Sent: Thursday, May 30, 2013 5:29 PM
To: archive-crawler@yahoogroups.com
Subject: Re: [archive-crawler] Wayback Access Point problem





Hi,



I think you&#39;ll find it works more reliably if you set up the access point as



http://www.xyz.com/xml/

rather than



http://www.xyz.com/archives/xml/

I believe trying to set up one access point inside another one will confuse
Wayback.



Thanks,

Andy



